import style from './Features.module.css'
import photoAction from '../../photos/photoAction.png'

const Features = () => {
  return (
    <div className={style.featuresContainer}>
      <div className="frameFeatures">
        <img src="../photos/photoAction.png" alt={'photo of Features'}></img>
        <div className="framText"></div>
      </div>
    </div>
  )
}

export default Features
